import React from 'react';
import Header from './Components/Header';
import Footer from './Components/Footer';
import Video from './Components/Video';
import './Videopage.css';

// Lista manual de vídeos destacados
const videosDestacados = [
    {
        id: 'dQw4w9WgXcQ', // ID do vídeo no YouTube
        titulo: 'Vídeo Incrível #1',
        canal: 'Canal Exemplo',
        thumbnail: 'https://img.youtube.com/vi/dQw4w9WgXcQ/mqdefault.jpg'
    },
    {
        id: 'aBcD1EfGhI2', 
        titulo: 'Vídeo Incrível #2',
        canal: 'Outro Canal',
        thumbnail: 'https://img.youtube.com/vi/aBcD1EfGhI2/mqdefault.jpg'
    },
    {
        id: '3EfGhI4JkLm', 
        titulo: 'Vídeo Incrível #3',
        canal: 'Canal Extraordinário',
        thumbnail: 'https://img.youtube.com/vi/3EfGhI4JkLm/mqdefault.jpg'
    },
];

export default function Videopage() {
    return (
        <div>
            <Header />
            <div className="video-container">
                {videosDestacados.map((video) => (
                    <Video
                        key={video.id}
                        titulo={video.titulo}
                        canal={video.canal}
                        thumbnail={video.thumbnail}
                    />
                ))}
            </div>
            <Footer />
        </div>
    );
}
